import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
  grid: {
    height: "100vh",
    width: "100vw",
    display: "flex",
    flexDirection: "row",
    flexWrap: "wrap",
    background: "white",
  },
  sidebar: {
    height: "100vh",
    width: "15vw",
  },
  smallSidebar: {
    width: "5vw",
  },
  mainContent: {
    width: "85vw",
  },
}));
